https://fr.indiatrotter.com/sitemap.xml\" rel=\"nofollow ugc\">https://fr.indiatrotter.com/sitemap.xml</a></p>\n<p>Though both shows &#8220;success&#8221; status, both have different issues.</p>\n<p>With <a href=\"https://indiatrotter.com/sitemap.xml\" rel=\"nofollow ugc\">https://indiatrotter.com/sitemap.xml</a><br />\nDiscovered URL 0<br />\nError 0<br />\nValid with warning 0<br />\nValid 32<br />\nExcluded: 5.97 K</p>\n<p>With <a href=\"https://fr.indiatrotter.com/sitemap.xml\" rel=\"nofollow ugc\">https://fr.indiatrotter.com/sitemap.xml</a><br />\nDiscovered URL 375<br />\nError 0<br />\nValid with warning 0<br />\nValid 1<br />\nExcluded: 6K</p>\n<p>Is there anything I am supposed to get this sorted?&#8230;With almost the entire thing excluded.</p>\n<p>It is really disappointing to see all the efforts for so many months melt like this 🙁</p>\n<p>Thank you for all your help.<br />\nRegards,<br />\nAmitava</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"indiatrotter\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://wordpress.org/support/topic/exclude-url-5/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Exclude URL\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://wordpress.org/support/topic/exclude-url-5/\";