INSERT INTO `wp_trp_original_strings` VALUES("8", "Eu sou o Willian Lira");
INSERT INTO `wp_trp_original_strings` VALUES("9", "Mas quem é Willian Lira");
INSERT INTO `wp_trp_original_strings` VALUES("10", "Sou um jovem brasileiro, nascido em janeiro de 1998 na cidade de Guarulhos/SP, onde continuo até hoje.");
INSERT INTO `wp_trp_original_strings` VALUES("11", "Formado em Ciência da Computação pela universidade da cidade (UNG), o que me garante o honrado título de \"menino dos computer\".");
INSERT INTO `wp_trp_original_strings` VALUES("12", "E o que o Willian faz?");
INSERT INTO `wp_trp_original_strings` VALUES("13", "Minha profissão é Desenvolvedor Web Front-End, do latim: \"Aquele que faz sites e aplicações para a internet\".");
INSERT INTO `wp_trp_original_strings` VALUES("14", "Atuo na área desde meados de 2019, e sou privilegiado em poder dizer que trabalho com o que amo fazer!");
