INSERT INTO `wp_trp_original_strings` VALUES("18", "Outro motivo que me levou a desenvolver esse projeto foi ter mais um meio de por em prática minhas habilidades e conhecimentos.");
INSERT INTO `wp_trp_original_strings` VALUES("19", "Pude aplicar e aprimorar meus conhecimentos enquanto desenvolvia todas as etapas desse site, desde domínio e hospedagem, tipografia e cores, desenho do layout e lógica de negócio, até o desenvolvimento e colocá-lo no ar.");
INSERT INTO `wp_trp_original_strings` VALUES("20", "E também, é por aqui que eu te ofereço a oportunidade de ter um site feito, assim como esse, 100% à mão por mim para você ou sua empresa!");
INSERT INTO `wp_trp_original_strings` VALUES("21", "Clique no botão abaixo para descobrir o que torna um site feito à mão a melhor escolha para você, e também para ver as opções de sites que eu ofereço.");
